con:testCase.con:setupScript:
log.info("begin test case start up");
def assigningAuthority = context.testCase.testSuite.project.getPropertyValue("DocQuery.PatientAssigningAuthority");
def patientId = context.testCase.testSuite.project.getPropertyValue("DocQuery.PatientId");
context.testCase.setPropertyValue('QualifiedPatientId', "'${patientId}^^^&amp;${assigningAuthority}&amp;ISO'");
log.info("patientid="+context.testCase.getPropertyValue('QualifiedPatientId'));
log.info("end test case start up");

con:soapui-project.con:afterLoadScript:
log.info("begin project start up");

log.info("load properties from file");
def propertiesFile = new File(new File(project.path).parent, 'LoadTestWithLightWeightAdapterComponents-soapui-project.properties');

if (propertiesFile.exists()) {
     def count=0;
	def props = new Properties()
	props.load(new FileReader(propertiesFile))
	props.each { key, value ->
          count=count+1;
		log.info("setting property " + key + "=" + value);
		project.setPropertyValue(key, value);
	}
	log.info("loaded " + count + " values");
}
log.info("load properties from file complete");

log.info("load properties from endpoint file");
propertiesFile = new File(new File(project.path).parent, 'endpoints.properties');

if (propertiesFile.exists()) {
     def count=0;
	def props = new Properties()
	props.load(new FileReader(propertiesFile))
	props.each { key, value ->
          count=count+1;
		log.info("setting property " + key + "=" + value);
		project.setPropertyValue(key, value);
	}
	log.info("loaded " + count + " values");
}
log.info("load properties from endpoint file complete");

log.info("end project start up");
